    "Winter waterfowl survey, southeastern Alaska",nt"tracking_summary": {ntt"total":
    8,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-06-17T01:56:16.204058",nt"name": "winter-waterfowl-survey-southeastern-alaska",nt"isopen":
    false,nt"url": null,nt"notes": "Little is known of the total numbers of
    wintering waterfowl within the north pacific coastal region. The random stratified
    plot sampling methods used in 1980, as modified and the study area expanded to include
    the entire saltwater habitat in northern southeast Alaska. We found a wintering
    duck population that included scoter, goldeneye, mallard, and others. Other bird
    and sea mammal population estimates are given. Useful waterfowl population information
    can be gathered with the plot method. Reliable visibility correction factors need
    to be determined concurrently with surveys. Survey expansion is recommended.",nt"license_title":
